	function addSlantedWatermarkLine(doc, startpos, lineLength, angleInDegrees, lineY) {

		// Draw the line
		doc.setFontSize(15);
		doc.setTextColor(200); // Set color
		doc.setFont('helvetica'); // Use a font
		const {h} = doc.getTextDimensions("Referance Booking Document, Not a Confirmation");
		doc.text("Referance Booking Document, Not a Confirmation", startpos, 100+h/2, angleInDegrees, 10);

	}


	function addWaterMark(doc) {

		  var totalPages = doc.internal.getNumberOfPages();
		  var WATERMARK_WIDTH =75;
		  var WATERMARK_HEIGHT =75;
		  for (i = 1; i <= totalPages; i++) {
			doc.setPage(i);
			//doc.addImage(imgData, 'PNG', 40, 40, WATERMARK_WIDTH, WATERMARK_HEIGHT);
			doc.setTextColor(150);
			doc.text(50, doc.internal.pageSize.height - 30, 'Watermark');
		  }
		  return doc;
	}


